import React, { Component } from 'react';
import logo from './img/logo.png';

class HeadLogo extends Component {

    render(){
        return(
        <div className="mx-auto">
            <img src={logo} className="img-fluid" alt="baldacci logo" />
        </div>
        );
    }
}

export default HeadLogo;
